import React from "react";
import './index.css';

const conteudos = [
  {
    conteudo: 'High Order Functions',
    bloco: 8,
    status: 'Aprendido'
  },
  {
    conteudo: 'Composicao de Componentes',
    bloco: 11,
    status: 'Aprendendo',
  },
  {
    conteudo: 'Composicao de Estados',
    bloco: 12,
    status: 'Aprenderei'
  },
  {
    conteudo: 'Redux',
    bloco: 16,
    status: 'Aprenderei'
  },
];

const listContents = (value) => {
  <span>{value}</span>;
}

class Content extends React.Component () {
  render() {
    return (
      conteudos.map((item) => 
        <div>
          {listContents(item.conteudo)}
          {listContents(item.bloco)}
          {listContents(item.status)}
        </div>
      )
    )
  }
}

export default Content;
